let currentToken = null;
let currentAttribute =null;

let stack = [{type: "documnet",children:[]}];
let currentTextNode = null;

function eimt(token){
    // console.log(token);
    let top = stack[stack.length -1];
    if(token.type == "startTag"){
        let element ={
            type:"element",
            children:[],
            attributes:[]
        };

        element.tagName = token.tagName;

        for(let p in token){
            if(p != "type" && p != "tagName")
                element.attributes.push({
                    name:p,
                    value: token[p]
                });
        }

        top.children.push(element);
        element.parent = top;

        if(!token.isSelClosing)
            stack.push(element);
        currentTextNode = null;
    }else if(token.type == "endTag"){
        // console.log(top.tagName+'======'+token.tagName)
        if(top.tagName != token.tagName){
            throw new Error("Tag start end dosen't match!");
        }else{
            stack.pop();
        }

        currentTextNode = null;
    }else if(token.type == "text"){
        if(currentTextNode == null){
            currentTextNode = {
                type :"text",
                content:""
            }
            top.children.push(currentTextNode);
        }
        currentTextNode.content += token.content;
        console.log(currentTextNode.content);
    }

}

const EOF = Symbol('EOF'); //end of flie

function data(c){
    if(c == "<"){
        return tagOpen;
    }else if(c == EOF){
        eimt({
            type:"EOF"
        });
        return ;
    }else {
        eimt({
            type:"text",
            content:c
        });
        return data;
    }
}

function tagOpen(c){
    if(c == "/"){
        return endTagOpen;
    }else if(c.match(/^[a-zA-Z]$/)){
        currentToken ={
